        }}

        button.secondary:hover {{
            background-color: #5a6268;
        }}

        .node {{
            cursor: pointer;
            transition: var(--transition);
        }}

        .node:hover circle {{
            stroke-width: 3px;
            stroke: #fff;
        }}

        .link {{
            stroke: #9baee5;
            stroke-opacity: 0.6;
            transition: var(--transition);
        }}

        .link:hover {{
            stroke-opacity: 1;
            stroke-width: 3px !important;
        }}

        .node text {{
            pointer-events: none;
            font-size: 12px;
            font-weight: 500;
            fill: white;
        }}

        .user-node {{
            fill: var(--primary-color);
            stroke: #3a5ad1;
            stroke-width: 2px;
        }}

        .agent-node {{
            fill: var(--success-color);
            stroke: #218838;
            stroke-width: 2px;
        }}

        /* Tooltip style */
        .tooltip {{
            position: absolute;
            background-color: white;
            padding: 10px;
            border-radius: var(--border-radius);
            box-shadow: var(--box-shadow);
            pointer-events: none;
            opacity: 0;
            transition: var(--transition);
            font-size: 12px;
        }}

        /* Loading indicator */
        .loading {{
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 18px;
            color: var(--secondary-color);
        }}

        /* Responsive design */
        @media screen and (max-width: 768px) {{
            .main-content {{
                flex-direction: column;
            }}

            .details-panel {{
