        if not user_id:
            user_id = author.get('user_openid')
        if not user_id:
            user_id = author.get('member_openid')
        if not user_id:
            user_id = event_data.get('user', {}).get('openid')
        if not user_id:
            user_id = event_data.get('openid')
        return user_id

